main:
	li $s0, BASE_ADDRESS 
	li $s1, MAX_ADDRESS
	
	jal level_1_set			# Create the background
	jal character			# Create the character
	
	j input_checker

level_1_set:
	la $t0, 0($s0)			# set $t0 to the BASE_ADDRESS
	la $t1, level_1			# set $t1 to level_1
	start_level_1_loop:
	bge $t0, $s1, end_start_level_1
	lw $t2, 0($t1)
	sw $t2, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	j start_level_1_loop
	end_start_level_1:
	jr $ra

# li $t0, BASE_ADDRESS    	# Set $t0 to BASE_ADDRESS
# move $a0, $t0 			# Set a0 to BASE_ADDRESS (will be changed to the current position)
# move $a1, $t0 			# Set a1 to BASE_ADDRESS (will be changed to the new position)
# jal character	
# j input_checker
    
input_checker:
	li $s7, 0xffff0000
    	lw $s6, 0($s7)
    	beq $s6, 1, input_detected      # if any input, go to the input function
    	j input_checker             	# else go keep checking for any input

input_detected:
	lw $t9, 4($s7)
    	beq $t9, 0x61, left_motion	# if input is 'a', move left
    	beq $t9, 0x77, climb_up		# if input is 'w', move up
    	beq $t9, 0x73, climb_down	# if input is 's', move down
    	beq $t9, 0x64, right_motion	# if input is 'd', move right
    	beq $t9, 0x71, main		# if input is 'p', restart the game

	j input_checker
	
right_motion:
	la $t0, 5420($s0)
	
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	addi $s0, $s0, 4
	
	jal character
	
	j input_checker

	
stair_up_check:
	sw $s4, -256($t0)
	li $s3, STAIRS
	bne $s4, $s3, input_checker
	
	jr $ra

left_motion:
	la $t0, 5420($s0)
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	addi $s0, $s0, -4
	
	sw $t7, 6188($s0)
	beq $t7, SPIKES, exit
	
	jal character
	
	j input_checker


climb_up:
	la $t0, 5420($s0)
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	addi $s0, $s0, -256
	
	jal character
	
	j input_checker
	
climb_down:
	la $t0, 5420($s0)
	
	sw $t3, 0($t0)
	sw $t4, 256($t0)
	sw $t5, 512($t0)
	sw $t6, 768($t0)
	
	addi $s0, $s0, 256
	
	jal character
	
	j input_checker


character:
    	la $t0, 5420($s0)
	li $t1, LEGS
	li $t2, HEAD
	
	lw $t3, 0($t0)
	lw $t4, 256($t0)
	lw $t5, 512($t0)
	lw $t6, 768($t0)
	
	
	sw $t2, 0($t0)			# Set the head green
	sw $t1, 256($t0)		# Set the legs to brown
	sw $t1, 512($t0)		# Set the legs to brown
	sw $t1, 768($t0)		# Set the legs to brown
	
	jr $ra

exit:
	li $v0, 10
    	syscall

	
